script: |
  super -f text -I q4427.spq | sort > q4427.out

inputs:
  - name: q4427.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE NOT + col1 + + + col0 BETWEEN + - 60 + + col1 * col0 - - + col1 + + col1 + - col2 / + 5 - col2 AND NULL;
  - name: tab2

outputs:
  - name: q4427.out
    data: |
      46	51	23
      64	77	40
      75	67	58
